#include "ecos.h"
#include "problem.h"

#include <time.h>


pwork* solver_work;

int solution()
{

    gather_matrices();

    solver_work = ECOS_setup(
             11018,  // number of vars
             4679,  // number of inequality constrs
             8402,  // p is number of equality constrs

             // l is positive orthant dimension
             // the first l elements of s are >= 0
             // in Gx + s = h
             402,
             // len(q), number of cones
             1189,
             q,    // dimension of each cone
             0,    // number of exponential cones (UNSUPPORTED)
             Gpr,  // G coeffs  (CCS)
             Gjc,  // col_idx   (CCS)
             Gir,  // row_ptr   (CCS)
             Apr,  // A coeffs  (CCS)
             Ajc,  // col_idx   (CCS)
             Air,  // row_ptr   (CCS)
             c,   // obj coeffs
             h,  // Gx cone offsets
             b  // Ax offsets
    );

    if (solver_work != NULL){
        printf("About to solve \n");
    } else {
        printf("About to solve, but solver work is NULL \n");
    }


    return (int) ECOS_solve(solver_work);
}

void solution_cleanup(){
    ECOS_cleanup(solver_work, 0);
}

